  // group the data: one array for each value of the X axis.
  const dataByYear = d3.group(data, d => d.year);
    
  // Stack the data: each group will be represented on top of each other
  const mygroups = ["Helen", "Amanda", "Ashley"] // list of group names
  const mygroup = [1,2,3] // list of group names
  //stackedData for 1,2,3 groups
  const stackedData = d3.stack()
    .keys(mygroup)
    .value(function(d, key) {
      //d[1] array content
      //d[1][key] key is 1,2,3 positions for the 7 or 9 items
      return d[1][key].n // value n each row by row
    })
    (dataByYear)

  // Add X axis --> it is a date format
  const x = d3.scaleLinear()
    //domain pair ['1880', '2015']
    .domain(d3.extent(data, function(d) { return d.year; }))
    .range([ 0, width ]);
  svg.append('g')
    .attr('transform', `translate(0, ${height})`)
    .call(d3.axisBottom(x).ticks(5));

  // Add Y axis
  //Max value in 'n' attribute | d3.max(data, function(d) { return + d.n; })
  const y = d3.scaleLinear()
    .domain([0, d3.max(data, function(d) { return + d.n; }) * 1.2])
    .range([ height, 0 ]);
  svg.append('g')
    .call(d3.axisLeft(y));

  // color palette with mygroups
  const color = d3.scaleOrdinal()
    .domain(mygroups)
    .range(['#e41a1c','#377eb8','#4daf4a','#984ea3','#ff7f00','#ffff33','#a65628','#f781bf','#999999'])

  // Show the areas
  svg
    .selectAll()
    .data(stackedData)
    .join('path')
      //with mygroups choose the color
      .style('fill', function(d) { name = mygroups[d.key-1] ; return color(name); })
      .attr('d', d3.area()
        .x(function(d, i) { return x(d.data[0]); })
        .y0(function(d) { return y(d[0]); })
        .y1(function(d) { return y(d[1]); })
    )
  </script>
